import React from 'react';
import PropTypes from 'prop-types';
import styles from './Recipient.module.css';

const Recipient = (props) => {
  const { recipientName } = props;
  const { recipientProfileImage } = props;

  return (
    <div className={styles.container}>
      <img className={styles.recipientProfilePhoto} alt="Ian Robinson" src={recipientProfileImage} />
      <div className={styles.labelContainer}>
        <p className={styles.nameText}>{recipientName}</p>
        <p className={styles.descriptionText}>Enter Amount to Pay</p>
      </div>
    </div>
  );
};

Recipient.propTypes = {
  recipientName: PropTypes.string,
  recipientProfileImage: PropTypes.string
}

export default Recipient;
